data: "<?xml version=\"1.0\"?>\n<problem showanswer=\"closed\" rerandomize=\"never\"\
  \ weight=\"10\">\n  <text>\n    <p>\nA multiple choice problem presents radio buttons\
  \ for student input. Students can only select a single option presented. Multiple\
  \ Choice questions have been the subject of many areas of research due to the early\
  \ invention and adoption of bubble sheets. </p>\n    <p>\nOne of the main elements\
  \ that goes into a good multiple choice question is the existence of good distractors.\
  \ That is, each of the alternate responses presented to the student should be the\
  \ result of a plausible mistake that a student might make. </p>\n    <p>\nWhat Apple\
  \ device competed with the portable CD player? </p>\n    <p>\n      <optionresponse>\n\
  \        <optioninput options=\"('The iPad','Napster','The iPod','The vegetable\
  \ peeler','Android','The Beatles')\" correct=\"The iPod\"/>\n      </optionresponse>\n\
  \    </p>\n  </text>\n</problem>\n"
